INSERT INTO `igo_goods` ( `goods_id`, `cat_id`, `goods_sn`, `goods_name`, `goods_name_en`, `goods_name_style`, `click_count`, `brand_id`, `provider_name`, `goods_number`, `goods_weight`, `market_price`, `virtual_sales`, `shop_price`, `promote_price`, `promote_start_date`, `promote_end_date`, `warn_number`, `keywords`, `keywords_en`, `goods_brief`, `goods_brief_en`, `goods_desc`, `goods_desc_en`, `goods_thumb`, `goods_img`, `original_img`, `is_real`, `extension_code`, `is_on_sale`, `is_alone_sale`, `is_shipping`, `integral`, `add_time`, `sort_order`, `is_delete`, `is_best`, `is_new`, `is_hot`, `is_promote`, `bonus_type_id`, `last_update`, `goods_type`, `seller_note`, `give_integral`, `rank_integral`, `suppliers_id`, `is_check`, `seller_note_en` ) VALUES  ('452', '36', 'GTY536303709113', '0037艺蓝 可爱猫妃韩国笔袋 学生铅笔袋 防水文具收纳袋 创意文具', '', '+', '0', '28', '', '9999', '0.000', '0.00', '0', '2.60', '0.00', '0', '0', '1', '0037艺蓝 可爱猫妃韩国笔袋 学生铅笔袋 防水文具收纳袋 创意文具', '', '', '', '<img src=\"/images/20170522/GTY536303709113_10550.jpg\"><br /><img src=\"/images/20170522/GTY536303709113_10551.gif\"><br /><img src=\"/images/20170522/GTY536303709113_10552.jpg\"><br /><img src=\"/images/20170522/GTY536303709113_10553.jpg\"><br /><img src=\"/images/20170522/GTY536303709113_10554.jpg\"><br /><img src=\"/images/20170522/GTY536303709113_10555.jpg\"><br /><img src=\"/images/20170522/GTY536303709113_10556.gif\"><br /><img src=\"/images/20170522/GTY536303709113_10557.jpg\"><br /><img src=\"/images/20170522/GTY536303709113_10558.gif\"><br /><img src=\"/images/20170522/GTY536303709113_10559.gif\"><br /><img src=\"/images/20170522/GTY536303709113_10560.gif\"><br /><img src=\"/images/20170522/GTY536303709113_10561.gif\"><br /><img src=\"/images/20170522/GTY536303709113_10562.jpg\"><br /><img /></p><p></p><p>&nbsp;</p><p>买家必读&nbsp;</p><p align=\"center\">&nbsp;</p><p>亲们，为了合作更愉快，请您花几分钟详细阅读以下几 点:<br />&nbsp;</p><p>1、本店的所有宝贝有水印的均实物拍摄,所见即所得,实物与图片基本一至,一分钱一分货,质量保证,请各位顾客 放心购买 。<br />&nbsp;</p><p>2、调退换货：由于是在摄影棚中拍照，颜色与图片有差异，图片因每台电脑的分辨率，显示器，显卡等原因可能存在微小差异，这是正常现象！如商品包装袋破损，影响二次销售的，则不予以退换。</p><p>&nbsp;</p><p>3、色差问题：因每个人的眼光,显示器问题,实物 跟图片会有一定的色差,像我们平时照相也 一样,图片是比较光鲜的,而实物是暗暗的,所以请在乎色差的顾客要慎重考虑后再拍.</p><p>&nbsp;</p><p>4、评价问题：评价：我非常重视每一位买家的评价，力求做到服务上的完美，如果您收到宝贝后觉得有什么不满意的地方，请先不要急于评价，迅速联系店主详谈一定会给您一个妥善解决的方法，也请在为您解决问题后给出真诚的评价。&nbsp;</p><p align=\"center\">&nbsp;</p><p>5、质量问题：发货前都会有专门的部门装箱，应无质量问题，但无法做到百分百，没有水印的图片，产品基本是高仿的，若因与正品不一至的，请恕接待不起。如产品确实存在本身的瑕疵，请在收到的48小时内及时联系我们，一定为您妥善解决，</p><p align=\"center\">&nbsp;</p><p>&nbsp;A.非质量问题退换货来回邮费均由买家自行负责.<br />&nbsp;</p><p>&nbsp;B.退换货的时候请保证跟原来包装一样,不影响下次销售,包装袋等.<br />&nbsp;</p><p>&nbsp;C.收货时请您本人签收,并在送货人员面前检查商品无损坏的情况下签收,如由它人代为签收或是直接签收后发现商品有损坏,本店有权不接受您的换退货处理哦~!<br />&nbsp;</p><p>所以本店对于不 属于质量问题的一概不与负责。如果您不经我们得允许退回货品,出现的任何损失费用,都有买家自己承担.&nbsp;</p><p align=\"center\">&nbsp;</p><p>6、尺寸问题：每件商品都有量取详细尺寸，每个人量法不同，2C M左右误差属正常。要是事后以推荐尺码错误理由怪罪卖家，那很抱歉，不接受以此为理由的退货。</p><p>&nbsp;</p><p>7、快递问题：本店合作的快递公司，一般按正常 时间到达,有时特殊情况会迟一两天,特别是遇到恶劣天气以及法定节假日，都会有延迟耽搁现象。因各地快递派送时间不同,会出现周末不派送情况,另外快递公司每个网点的业务员素质也不一，中间可能出现个别网点业务员态度不好或者包裹损坏等，一些卖家无法预知的意外因素。总之有什么不愉快请联系我们， 我们会积极跟快递公司沟通解决的。</p>', '', '/images/201705/source_img/GTY536303709113_10545.jpg', '/images/201705/source_img/GTY536303709113_10545.jpg', '/images/201705/source_img/GTY536303709113_10545.jpg', '1', '', '1', '1', '0', '0', '1495526793', '100', '0', '0', '0', '0', '0', '0', '1495526793', '10', '', '-1', '-1', '0', '', '');
